
def test_generate_user_code_json_presenter():
    from ib_users.presenters.user_profile_json_presenter import UserProfileJSONPresenter

    presenter = UserProfileJSONPresenter()

    user_code = "123456"

    user_code_dict = {
        "user_code": user_code
    }

    presenter_user_code = presenter.generate_user_code(user_code=user_code)

    assert presenter_user_code == user_code_dict
